import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import BranchListing from './components/BranchListing';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <BranchListing />
      </div>
    </Router>
  );
}

export default App;
